import React from 'react'
import Elements from './Elements'
import items from './ElementsData'


function Card() {

  const elementsDetails = items.map(items => {
    return (
      <Elements
        img= {items.img}
        type= {items.type}
        city={items.city}
        saledeadline={items.saledeadline}
      />
    )
  })

  return (
    <div className='card-div'>

      <Elements
        img={Veh}
        type="Vehicles"
        city="Fairfax, VA"
        saledeadline="Sale Ends in 10 days!"
      />
      <Elements
        img={Courts}
        type="Courts"
        city="Fairfax, VA"
        saledeadline="Sale Ends in 15 hours!"
      />
      <Elements
        img={Eq}
        type="Others"
        city="Fairfax, VA"
        saledeadline="Sale Ends in 10 days!"
      />
    </div>
  )
}

export default function MainContent() {
  return (
    <div className='main'>
      <h1>We Offer!!</h1>
      <Card />
      <span>
        <h1>Register Today!!</h1>
        <p>We have what you need!! Rent Anything, Anywhere!</p>
      </span>
    </div>
  );
}
